import React from 'react';
import '../styles/About.css'; // We will create this CSS file next.

function About() {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>This section will contain information about yourself, your skills, and your experience.</p>
    </section>
  );
}

export default About;
